import React from 'react';
import { Container, Row, Col, Nav } from 'react-bootstrap';

const BiteFooter = () => {
  return (
    <Container fluid className="bg-light py-5 px-4">
      <Row className="g-4">
        {/* SHOP Column */}
        <Col md={3}>
          <h5 className="mb-4">SHOP</h5>
          <Nav className="flex-column fs-6">
            <Nav.Link href="#" className="px-0 py-1">All Products</Nav.Link>
            <Nav.Link href="#" className="px-0 py-1">Oral Care</Nav.Link>
            <Nav.Link href="#" className="px-0 py-1">Personal Care</Nav.Link>
            <Nav.Link href="#" className="px-0 py-1">Bundles</Nav.Link>
          </Nav>
        </Col>

        {/* ABOUT Column */}
        <Col md={3}>
          <h5 className="mb-4">ABOUT</h5>
          <Nav className="flex-column fs-6">
            <Nav.Link href="#" className="px-0 py-1">Sustainability</Nav.Link>
            <Nav.Link href="#" className="px-0 py-1">About Us</Nav.Link>
            <Nav.Link href="#" className="px-0 py-1">FAQ</Nav.Link>
            <Nav.Link href="#" className="px-0 py-1">Store Locator</Nav.Link>
          </Nav>
        </Col>

        {/* Certifications Section */}
        <Col md={6} className="d-flex flex-column justify-content-between">

        </Col>
      </Row>

      {/* Copyright Row */}
      <Row className="mt-5">
        <Col>
          <p className="text-muted fs-6">Â© 2028 Bite. All Rights Reserved.</p>
        </Col>
      </Row>
    </Container>
  );
};

export default BiteFooter;
